import React from "react";
import projectphoto from "../../Images/25-11-21 Workshop";
import "./CradUi.css";

const CardUi = () => {
  return (
    <div className="cardbody">
      <div className="card text-center">
        <div className="overflow">
          <img src={projectphoto} alt="Event image" className="card-img-top" />
        </div>
        <div className="card-body text-dark"></div>
        <h4 className="card-title">
          Workshop on Environment setup for python and c++
        </h4>
        <p className="card-text text-secondary">
          Date: 25/11/21 <br /> Time: 04:00 pm – 06:00 pm <br />
          Venue: CompScE ‘94 Hall
        </p>
      </div>
    </div>
  );
};

export default CardUi;
